    const [isCategori,setIsCategori] = useState('전체');


    return(
        <>
          <Banner onBannerTab={'프로'} aniWidth={'50%'}/>
          <section className="size1442 proArea">
            <div>
                {categoriList.map((el,index) => <button className={isCategori === el ? 'active' : ''} onClick={() => setIsCategori(el)} key={index}>{el.categori}</button>)}
            </div>
            <ul>
                
            </ul>
          </section>
        </>

    )
}
